import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './index.css';
import App from './containers/App';

ReactDOM.render((
    <Router>
        <Route exact path="/" component={App} />
    </Router>),
    document.getElementById('root')
);
